import React from 'react';
import { BrowserRouter } from "react-router-dom"
import AppRoutes from './Routes'
import './App.css';

function App() {


	return (
		<div className="App">

			<button className="add-button">
			<img className="icon" alt="" src={require('./components/media/icons/install.png').default} />
			</button>
			<h1> INSTABLAM </h1>

			<BrowserRouter>
				<AppRoutes />
			</BrowserRouter>
		</div>
	);
}

export default App;
